import { createTheme, ThemeProvider } from '@mui/material/styles';

export const theme = createTheme({
    palette: {
        main: '#f39d09',
        primary: "#1c1c1c",
        secondary: "#7d7c7e",
        light: '#ecedee',
        white: '#fff',
    },
  });
